import api from "./baseApi";

export const checkPointApi = {
  getCheckPoints(params, cancelToken) {
    return api.get("/api/admin/check-point", { params, cancelToken });
  },
  getCheckPoint(params) {
    return api.get(`/api/check-point/${params.id}`, { params });
  },
  getProfile(params) {
    return api.get("/api/users/profile", { params });
  },
  editCheckPoint(params, id) {
    return api.put(`api/check-point/${id}`, params);
  },
  deleteCheckPoint(params) {
    return api.delete(`/api/check-point/${params.id}`);
  },
  createCheckPoint(params) {
    return api.post("/api/check-point", params);
  },
};
